import React from 'react';

function Calculator(){
    function add(a,b){
        return (a+b);
    }
    function sub(a,b){
        return (a-b);
    }
    function div(a,b){
        return (a/b);
    }
    function mult(a,b){
        return (a*b);
    }
    return(
        <ol>
            <li> Sum of two no. is {add(a,b)} </li>
            <li> Subtraction of two no. is {sub(a,b)} </li>
            <li> Division of two no. is {div(a,b)} </li>
            <li> Multiplication of two no. is {mult(a,b)} </li>
        </ol>
    );
}

export default Calculator;
